  function App() {
    return (
        <div>
          <Navbar/>
          <Switch>
            <Route path='/' exact >
              <Landing />
              <Search />
            </Route>
            <Route path='/' render={ () => <Search />} />
            <Route component={Error} /> 
          </Switch>
        </div>
    )
  }


export default App;
